(10,'Tokyo Revengers','Watching the news, Takemichi Hanagaki learns that his girlfriend from way back in middle school, Hinata Tachibana, has died. The only girlfriend he ever had was just killed by a villainous group known as the Tokyo Manji Gang. He lives in a crappy apartment with thin walls, and his six-years-younger boss treats him like an idiot. Plus, hes a complete and total virgin  At the height of his rock-bottom life, he suddenly time-leaps twelve years back to his middle school days!! To save Hinata, and change the life he spent running away, hopeless part-timer Takemichi must aim for the top of Kantos most sinister delinquent gang!!','Ken Wakui','Action-thriller','2021-11-01','Kodansha','PNG\r\n\Z\n\0\0\0\rIHDR\0\0\0\0\0\0\0J\0\0 \0IDATxyuCUpIG:%B<a&~It\rI$2838vl6$}j]TWWWZw;kZRtRHd\0(	x^\ZbKw]v!L^}5$`%wpAa\n(P\"ZRITB!(9	p {\nxy!\"\rR@W:u\nN\n\0H\nZ@(0&N\"Du\Z%\Z8q(-\n%(^p)JH=B(\nZ\0\n(Dtp4E(.Dp} [hQ0.rx$VhRo{#\0c+`x 4@h(PoZLuTb!1u8L6 RK\r\nV\Zk^\np<|M(<\n^tl\nI\'@ \0I#\n(pCgC\Z@8;u\nG)Y\Zc_x6\nH!@(AV\\-GOtJ2D+b\n(pC}go3n\0$	c+S?}z0i%q5$__R)PR$!%TxGr##QPF\nP@+}\'6ykBW`lj^|v?gM26\n\nJb\\SN x%=%\'r)z+V+\"R(,\r*(Pn?sp]1jx\0.VXb 2b(u){L{\n(\n@bAJ4x(/xM[Q	O	B-^@5omeSO;Ps,[9B=IC\"ZO4 \"s8kDYq	L9T[8QJC*;T9S\"%a|$\\;(PE\nuj:&O}/Gw>i2xt\Z!@F(h@)&)DADxerEJ\"?IM{m+&WmZ\nxKJ?\\90{Tq(%q>/\\-BP^mK-P@\"BYdZ!IVoL2/g/y_@93{8\"	yc3$lzpV\"23u\0TJhY(X9RN3\'-B8&(/(P@/7P`I}}Daz}r+a3rBxqD|Qa@W<+J+R,E)`I28i 4hbq\"|\n\" \n(pC2WlabQ@\ZaQyj=:=G#;<=j	&OF(B\nBx\n!<H\'|s<n-_AU&)Q^(PEoo\r4t[89:zz<Y*%%ebK+Rd,uv/^bw]h|I9Apy%q%7nGv;~&\Z^!P%%\ZrZyF@{\rgr;H#{?	z>Vm\"ipA|~-l[Fia5/u_.}bXxHZxif&q])r_=7^C\\(<)A\0&\"@ZJ]KR]OI\'AmmZBj;;:RQAk_?= &\"=ZaSo|hE:3SP@1yCvfG]PO9	rI0x\nKQ\"`\'d-hm+